INSERT INTO "Xtra_Curr" VALUES(3031,'August Martin High School considers athletics to be an extension of the classroom and to be an important part of the high school experience. This holds true');
INSERT INTO "Xtra_Curr" VALUES(3032,'whether you are a student athlete or a member of our community rooting for the various teams. Historically');
