INSERT INTO "Xtra_Curr" VALUES(3034,'state and national exposure. We boast championships in Football');
INSERT INTO "Xtra_Curr" VALUES(3035,'Boys Basketball program and the Girls Basketball program which holds 11 PSAL Championships and 4 NYS Championships. It is expected that each student-athlete demonstrates their own leadership through team captain-ships and individual actions to improve their teams success. Our students become a part of a dynamic family that pursues excellence every day! So');
INSERT INTO "Xtra_Curr" VALUES(3036,'if your goal is to cheer our team victory or to compete against the citys best then August Martin is the school for you');
